import React, { useEffect, useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import {
  Container,
  Paper,
  Typography,
  Button,
  Box,
  Grid,
  Card,
  CardContent,
  LinearProgress,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Chip
} from '@mui/material';
import { CheckCircle, Cancel, Home, Assessment } from '@mui/icons-material';

const ResultsPage = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const [results, setResults] = useState(null);
  const [testId, setTestId] = useState('');

  useEffect(() => {
    if (location.state?.results) {
      setResults(location.state.results);
      setTestId(location.state.testId || '');
    } else {
      // If no results in state, redirect to home
      navigate('/');
    }
  }, [location, navigate]);

  if (!results) {
    return (
      <Container maxWidth="md" sx={{ mt: 4 }}>
        <Typography>Loading results...</Typography>
      </Container>
    );
  }

  const getScoreColor = (score) => {
    if (score >= 80) return 'success';
    if (score >= 60) return 'warning';
    return 'error';
  };

  const getPerformanceText = (score) => {
    if (score >= 80) return 'Excellent';
    if (score >= 70) return 'Good';
    if (score >= 60) return 'Average';
    if (score >= 50) return 'Below Average';
    return 'Needs Improvement';
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Paper elevation={3} sx={{ p: 4 }}>
        <Box sx={{ textAlign: 'center', mb: 4 }}>
          <Assessment sx={{ fontSize: 60, color: getScoreColor(results.score), mb: 2 }} />

          <Typography variant="h3" gutterBottom>
            Test Results
          </Typography>

          <Typography variant="h6" gutterBottom color="text.secondary">
            Cybersecurity Aptitude Assessment
          </Typography>
        </Box>

        {/* Overall Score */}
        <Card sx={{ mb: 4 }}>
          <CardContent>
            <Grid container spacing={3} alignItems="center">
              <Grid item xs={12} md={4}>
                <Box sx={{ textAlign: 'center' }}>
                  <Typography variant="h2" color={getScoreColor(results.score)}>
                    {results.score?.toFixed(1)}%
                  </Typography>
                  <Typography variant="h6" gutterBottom>
                    Overall Score
                  </Typography>
                  <Chip 
                    label={getPerformanceText(results.score)} 
                    color={getScoreColor(results.score)}
                    variant="outlined"
                  />
                </Box>
              </Grid>

              <Grid item xs={12} md={8}>
                <Typography variant="h6" gutterBottom>
                  Test Summary
                </Typography>
                <Grid container spacing={2}>
                  <Grid item xs={6}>
                    <Typography variant="body2" color="text.secondary">
                      Correct Answers
                    </Typography>
                    <Typography variant="h5">
                      {results.correctAnswers || 0} / {results.totalQuestions || 0}
                    </Typography>
                  </Grid>
                  <Grid item xs={6}>
                    <Typography variant="body2" color="text.secondary">
                      Duration
                    </Typography>
                    <Typography variant="h5">
                      {Math.floor(results.duration / 60)}m {results.duration % 60}s
                    </Typography>
                  </Grid>
                </Grid>

                <Box sx={{ mt: 2 }}>
                  <Typography variant="body2" color="text.secondary" gutterBottom>
                    Overall Progress
                  </Typography>
                  <LinearProgress 
                    variant="determinate" 
                    value={results.score} 
                    color={getScoreColor(results.score)}
                    sx={{ height: 10, borderRadius: 5 }}
                  />
                </Box>
              </Grid>
            </Grid>
          </CardContent>
        </Card>

        {/* Category Breakdown */}
        {results.categoryScores && (
          <Card sx={{ mb: 4 }}>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Performance by Category
              </Typography>

              <TableContainer>
                <Table>
                  <TableHead>
                    <TableRow>
                      <TableCell>Category</TableCell>
                      <TableCell align="right">Correct</TableCell>
                      <TableCell align="right">Total</TableCell>
                      <TableCell align="right">Score</TableCell>
                      <TableCell align="right">Progress</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {Object.entries(results.categoryScores).map(([category, data]) => {
                      const percentage = data.total > 0 ? (data.correct / data.total * 100) : 0;
                      return (
                        <TableRow key={category}>
                          <TableCell>
                            <Typography variant="body2">
                              {category.replace('_', ' ')}
                            </Typography>
                          </TableCell>
                          <TableCell align="right">
                            <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'flex-end' }}>
                              {data.correct > 0 && <CheckCircle fontSize="small" color="success" sx={{ mr: 1 }} />}
                              {data.correct}
                            </Box>
                          </TableCell>
                          <TableCell align="right">{data.total}</TableCell>
                          <TableCell align="right">
                            <Chip 
                              label={`${percentage.toFixed(1)}%`}
                              size="small"
                              color={getScoreColor(percentage)}
                            />
                          </TableCell>
                          <TableCell align="right">
                            <Box sx={{ width: 100, display: 'inline-block' }}>
                              <LinearProgress 
                                variant="determinate" 
                                value={percentage} 
                                color={getScoreColor(percentage)}
                                sx={{ height: 8, borderRadius: 4 }}
                              />
                            </Box>
                          </TableCell>
                        </TableRow>
                      );
                    })}
                  </TableBody>
                </Table>
              </TableContainer>
            </CardContent>
          </Card>
        )}

        {/* Recommendations */}
        <Card sx={{ mb: 4 }}>
          <CardContent>
            <Typography variant="h6" gutterBottom>
              Recommendations
            </Typography>

            <Typography variant="body1" paragraph>
              Based on your performance, here are some recommendations for your cybersecurity training:
            </Typography>

            <Grid container spacing={2}>
              <Grid item xs={12} md={6}>
                <Paper elevation={1} sx={{ p: 2, height: '100%' }}>
                  <Typography variant="subtitle2" gutterBottom color="primary">
                    Focus Areas:
                  </Typography>
                  <ul>
                    {results.categoryScores && Object.entries(results.categoryScores)
                      .filter(([_, data]) => data.total > 0 && (data.correct / data.total) < 0.7)
                      .map(([category, _]) => (
                        <li key={category}>
                          <Typography variant="body2">
                            {category.replace('_', ' ')}
                          </Typography>
                        </li>
                      ))}
                  </ul>
                </Paper>
              </Grid>

              <Grid item xs={12} md={6}>
                <Paper elevation={1} sx={{ p: 2, height: '100%' }}>
                  <Typography variant="subtitle2" gutterBottom color="primary">
                    Next Steps:
                  </Typography>
                  <ul>
                    <li><Typography variant="body2">Review basic cybersecurity concepts</Typography></li>
                    <li><Typography variant="body2">Practice with hands-on labs</Typography></li>
                    <li><Typography variant="body2">Join the UR AFRETEC-MASTERCARD training sessions</Typography></li>
                    <li><Typography variant="body2">Explore online cybersecurity resources</Typography></li>
                  </ul>
                </Paper>
              </Grid>
            </Grid>
          </CardContent>
        </Card>

        {/* Actions */}
        <Box sx={{ display: 'flex', justifyContent: 'center', gap: 2, mt: 4 }}>
          <Button
            variant="contained"
            startIcon={<Home />}
            onClick={() => navigate('/')}
          >
            Return to Home
          </Button>

          {testId && (
            <Button
              variant="outlined"
              onClick={() => {
                // Implement download functionality here
                alert('Download feature coming soon!');
              }}
            >
              Download Results (PDF)
            </Button>
          )}
        </Box>

        <Typography variant="body2" sx={{ mt: 4, textAlign: 'center', color: 'text.secondary' }}>
          Thank you for completing the Cybersecurity Aptitude Test. 
          Your results will help tailor the UR AFRETEC-MASTERCARD training program to your needs.
        </Typography>
      </Paper>
    </Container>
  );
};

export default ResultsPage;
